import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';
import PlanechaseNewSession from './planechase/PlanechaseNewSession';
import PlanechaseLoadSession from './planechase/PlanechaseLoadSession';
import Planechase from './planechase/Planechase';

export default function App() {

  return (
    <Router>
      <Routes>
        <Route path="/:sessionCode" element={<Planechase />} />
      </Routes>
    </Router>
  );
}
